import React, {Component} from "react";
import './style.css';
import { Link } from "react-router-dom";
import axios from 'axios';

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: false
    }
  }

  logout = (e) => {
    e.preventDefault();
    console.log('logout was clicked');
    const {email, password} = this.state;
    axios.get("/logout", { email, password})
      .then((res) => {
   console.log('logged out user', res.data);
   localStorage.clear();

  })
  .catch((err)=>console.log('there was an error'));
}



render(){
return(
  <div>
        <nav className="navbar navbar-dark bg-dark">
      <ul className="nav">
        <li className="title">
          <p className="nav-header"><Link to={"/"}> the beauty bunny collective </Link> </p>
        </li>
        <li className="nav-item"><p id="login"><Link to={"/"} onClick={this.logout}>Logout</Link></p></li>
      </ul>
    </nav>
  </div>
)
}


